import React, { Component } from "react";
import {
  TextField,
  Container,
  Button,
  Tabs,
  Tab,
  TabPanel
} from "@material-ui/core";

export default class Lgon extends Component {
  state = {
    value: "one"
  };
  render() {
    return (
      <div>
        <Tabs value={this.state.value}>
          <Tab value="zero" label="LOGIN"></Tab>
          <Tab value="one" label="REGISTER"></Tab>
        </Tabs>
        <TabPanel value="zero"></TabPanel>
        <TabPanel value="one"></TabPanel>
      </div>
    );
  }
}
